class Card extends Component{
    render(){
        return(
            <React.Fragment>
                <section className="card-container">
                    <header>
                        <span initials="JS"></span>
                        <h2>Jane Smith</h2>
                    </header>
                </section>
            </React.Fragment>
        )
    }
}

export default Card;
